import ArticleEvents from 'components/common/ArticleEvents';
import React, { useState } from 'react';
import styled from 'styled-components';

function EventListConatiner({ eventList, addEventList, eventContent }) {
	const testArticle = new Array(12).fill(0);
	const [contentList, setContentList] = useState(
		eventContent.read().data.result,
	);
	console.log(contentList);
	return (
		<ContentList>
			<div className="evnetlist-content-container">
				{testArticle.map((value, index) => (
					<ArticleEvents />
				))}
			</div>
		</ContentList>
	);
}

const ContentList = styled.div`
	margin-top: 8px;
	max-width: 1060px;
	width: 87.72%;
	position: relative;
	margin: 0 auto;

	.evnetlist-content-container {
		margin: 0 -10px;
		::after {
			display: block;
			content: '';
			clear: both;
		}
	}
`;

export default EventListConatiner;
